import { Document, Page, StyleSheet, Text, pdf } from '@react-pdf/renderer';
import React, { useState } from 'react';
import styled from 'styled-components';
import { saveResumeApi } from '../../../apis/Api'; // Ensure this path matches your project structure

// Styles for PDF
const styles = StyleSheet.create({
    page: { flexDirection: 'column', padding: 30 },
    section: { marginBottom: 10 },
});

// PDF Document Component
const MyDocument = ({ formData }) => (
    <Document>
        <Page size="A4" style={styles.page}>
            <Text>Name: {formData.name}</Text>
            <Text>Email: {formData.email}</Text>
            <Text>Phone: {formData.phone}</Text>
            <Text>Previous Company: {formData.previousCompanyName}</Text>
            <Text>Job Title: {formData.jobTitle}</Text>
            <Text>Job Duration: {formData.jobDuration}</Text>
            <Text>Job Description: {formData.jobDescription}</Text>
            <Text>Highest Qualification: {formData.highestQualification}</Text>
            <Text>Education Institute: {formData.educationInstitute}</Text>
        </Page>
    </Document>
);

// Styled components
const Input = styled.input`
  margin-bottom: 10px;
  width: 300px;
  padding: 8px;
`;

const Button = styled.button`
  padding: 10px 20px;
  background-color: #108A00;
  color: white;
  border: none;
  border-radius: 5px;
`;

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-top: 20px;
`;

const PdfViewer = styled.iframe`
  width: 100%;
  height: 500px;
  border: none;
  margin-top: 20px;
`;

const FormAndPdf = () => {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        phone: '',
        previousCompanyName: '',
        jobTitle: '',
        jobDuration: '',
        jobDescription: '',
        highestQualification: '',
        educationInstitute: ''
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData(prev => ({ ...prev, [name]: value }));
    };

    const handleFormSubmit = async () => {
        const doc = <MyDocument formData={formData} />;
        const asPdf = pdf(); // Create an instance of PDF
        asPdf.updateContainer(doc);
        const blob = await asPdf.toBlob(); // Generate blob

        // FormData to send via HTTP
        const fileData = new FormData();
        fileData.append("file", blob, "resume.pdf");

        try {
            const response = await saveResumeApi(fileData); // Using the API function for file uploads
            console.log('Resume submitted successfully:', response.data);
        } catch (error) {
            console.error('Error submitting resume:', error);
        }
    };

    return (
        <Container>
            <Input type="text" name="name" value={formData.name} onChange={handleInputChange} placeholder="Enter name" />
            <Input type="email" name="email" value={formData.email} onChange={handleInputChange} placeholder="Enter email" />
            <Input type="text" name="phone" value={formData.phone} onChange={handleInputChange} placeholder="Enter phone number" />
            <Input type="text" name="previousCompanyName" value={formData.previousCompanyName} onChange={handleInputChange} placeholder="Previous Company Name" />
            <Input type="text" name="jobTitle" value={formData.jobTitle} onChange={handleInputChange} placeholder="Job Title" />
            <Input type="text" name="jobDuration" value={formData.jobDuration} onChange={handleInputChange} placeholder="Job Duration" />
            <Input type="text" name="jobDescription" value={formData.jobDescription} onChange={handleInputChange} placeholder="Job Description" />
            <Input type="text" name="highestQualification" value={formData.highestQualification} onChange={handleInputChange} placeholder="Highest Education Qualification" />
            <Input type="text" name="educationInstitute" value={formData.educationInstitute} onChange={handleInputChange} placeholder="Education Institute" />
            <Button onClick={handleFormSubmit}>Create Resume</Button>
        </Container>
    );
};

export default FormAndPdf;
